import { AddWakeTimeWindow, AddWorkWindow } from "./window/AddWindow";
import { WorkList } from "./WorkList";
export const OnSubmitWorkHook = (event) => {
  const validatorFun = (workObj) => {
    return workObj.workName && workObj.workTime;
  };
  const { workList, onSubmitWork } = usePushWork(validatorFun);

  return { workList, onSubmitWork };
};
export const WorkListTemplate = () => {
  const { workList, onSubmitWork } = OnSubmitWorkHook();
  localStorage.setItem("workList", JSON.stringify(workList));
  return (
    <div>
      <h1>Hamburger App</h1>
      <AddWakeTimeWindow />
      <WorkList />
      <AddWorkWindow />
      <ol>
        <li>Wake Up at 08:00 </li>
        <li>Clean My room 3h </li>
        <li>Do My homework 3h 20m </li>
        <li>Test comment 2h 1m </li>
        <li>Sleep at 01:00 </li>
      </ol>
    </div>
  );
};
